                      style={{
                        position:'absolute',
                        height:'25px',
                        lineHeight:'25px',
                        borderRadius:'3px',
                        backgroundColor:'white',
                        color:'black',
                        bottom:'5%',
                        left:'2%',

                      }}
                    >Hi! {userName}</button>
        </div>
    )
}

export default User;
